import { GuestNavigation } from "./navigation/GuestNavigation";
import { AdminNavigation } from "./navigation/AdminNavigation";
import { CurrentUserNavigation } from "./navigation/CurrentUserNavigation";

import AuthService from "../services/auth.service";

export const Header = ({ panel }) => {
  return (
    <>
      {panel.guest && <GuestNavigation />}
      {panel.currentUser && <CurrentUserNavigation />}
      {panel.showAdminBoard && <AdminNavigation />}
    </>
  );
};
